      <a href="https://www.linkedin.com/in/notomer/" className="classic-tab" target="_blank" rel="noopener noreferrer">
        LinkedIn
        <div className="gloss-layer"></div>
      </a>
      <a href="https://github.com/notomer" className="classic-tab active" target="_blank" rel="noopener noreferrer">
        GitHub
        <div className="gloss-layer"></div>
      </a>
      <EmailEncrypt/>
    </div>
  );
};

export default SocialLinks;
